import React from 'react';
import { Header } from 'semantic-ui-react';

const Footer = () => (
  <div style={{ 'textAlign':'center', 'fontSize':'150%', 'color': 'white', 'verticalAlign': 'middle', 'display': 'flex', height: '7vh', background: '#BEB19B', fontFamily: 'Didot', }}>
    Sorry, the page you're looking for cannot be found.
  </div>
);

export default Footer;
